import { colors } from "../../constants";

export const styles = {
  btn: {
    display: "flex",
    justifyContent: "center",
    width: "320px",
    height: "56px",
    backgroundColor: colors["darkBlue"],
    color: "white",
    alignItems: "center",
    fontSize: "16px",
    borderRadius: "32px",
    marginTop: "32px",
    "&:hover": {
      cursor: "pointer",
    },
  },
};
